package com.dilidili.of.entity;public class Owner extends BaseBean{	private String face;	private long mid;	private String name;	public String getFace() {		return this.face;	}	public void setFace(String face) {		this.face = face;	}	public long getMid() {		return this.mid;	}	public void setMid(long mid) {		this.mid = mid;	}	public String getName() {		return this.name;	}	public void setName(String name) {		this.name = name;	}	public String toString() {		return "Owner [face = " + face + ", mid = " + mid + ", name = " + name + "]";	}}